    private void Back()
    {
        if (statusNum == 0)
            return;
        statusNum--;
        ShowSkillView(1);
        ClickImg(1);
    }

    private void Forword()
    {
        if (statusNum == ttx.Count)
            return;
        statusNum++;
        ShowSkillView(1);
        ClickImg(1);
    }

